class Solution(object):
    def shortestPathBinaryMatrix(self, g):
        """
        :type g: List[List[int]]
        :rtype: int
        """
        v,n=set(),len(g)
        q,c = set([(0,0)]),1
        if g[0][0] == 1 or g[n-1][n-1] == 1: return -1
        if n == 1: return c
        while q:
            tmp = set()
            for a,b in q:
                v.add((a,b))
                for x,y in [(a-1,b),(a+1,b),(a,b-1),(a,b+1),(a-1,b-1),(a-1,b+1),(a+1,b-1),(a+1,b+1)]:
                    if 0<=x<n and 0<=y<n and (x,y) not in v and not g[x][y]: tmp.add((x,y))
            if not tmp: return -1
            c+=1
            if (n-1,n-1) in tmp: return c
            q = tmp
        
        return -1

